import {
  Card,
  CardContent,
  CardHeader,
  TextareaAutosize,
  TextField,
} from "@material-ui/core"

const CreatePost = () => {
  return (
    <div>
      <Card>
        <CardContent>
         <TextField
         multiline
         rows={2}
         rowsMax={6}
         fullWidth></TextField>
        </CardContent>
      </Card>
    </div>
  )
}

export default CreatePost
